import React from "react";
import { NavLink } from "react-router-dom";
class Navbar extends React.Component {


  render() {
    return (
      <>  
        <NavLink to={"/Exam"}>
          <button>Exam</button>
        </NavLink>        
          <NavLink to={"/Users"}>
            <button>User</button>
          </NavLink>

      </>
    );
  }
}
export default Navbar;
